import React from "react";

const RecentPractice =()=>{

    const getContainerStyle =()=>({
        // overflowX: 'auto',
        // whiteSpace: 'nowrap'
    });

    const getItemStyle=()=>({
        display: 'inline-block',
    });

    const imgs = [
        'img/ppt1.jpg',
        'img/ppt2.png',
        'img/ppt3.png',
        'img/ppt4.jpg',
    ];

    return(
        <>
        <div class="container pt-4 px-4"> 
            <div class="h-100 bg-light rounded p-4">
                <h6 class="mb-0">최근 연습</h6>
                <div class="bg-light  d-flex align-items-center overflow-auto">
                <div class="bg-light rounded d-flex align-items-center overflow-auto" style={getContainerStyle()}>
                    {imgs.map((path, index) => (
                        <div key={index} class="" style={getItemStyle()}>
                            <button class='btn btn-link'>
                                <img src={path} class="d-block" alt={`이미지 ${index + 1}`} />
                            </button>
                        </div>
                    ))}
                </div>
                </div>
            </div>
        </div>
        </>
    );
};

export default RecentPractice;
